@JarlePetterson @sbjoernstad @erlendwiborg Nå var det du som påstod at det er urimelig å sammenligne tjenestene. 

Begge tilbyr sportsspill og begge tilbyr kasino. 

Begge har ansvarlighetstiltak. Forskjellen er profitt går til idrett ene stedet og til aksjonærer og mer til spillerne andre stedet.

@JarlePetterson @sbjoernstad @erlendwiborg Det var et svar. Ikke et spørsmål. 

Pengespill er en lovlig tjeneste. Det må vi forholde oss til. Regulerer vi pengespill selv, kan vi flagge hjem skattekroner og verne problemspillerne våre.

Takk for praten :)

@oisteinm @abidraja Hei Øistein. Nå lyver du igjen. 

Norge er på topp hva gjelder problemspillere i henhold til befolkningsprevalens. Majoriteten av økningen i problemspillere fra 2015 til 2019 kom via monopolspill. 

Pengespillreklamen fra ikke norske selskaper er langt mildere i 2021 enn 2015.

Går av?
